        <Head>
            <style amp-custom>
                {`
                .container {
                    bbackground-color: #52bdae;
                    display: flex;
                }
                .teal_banner_line1{
                      font-size: 18px;
                      display: flex;
                }
                .teal_banner_line2{
                    font-size: 18px;
                    display: flex;
                }
                .teal_banner_line3{
                    font-size: 21px;
                    display: flex;
                    font-weight: bold;
                }

                `}
            </style>
        </Head>
        <body>
            <div class="container">
            <div class="addtocart_teal_banner">
                <p>
                    <p class="teal_banner_line1"> BECOME AN EXCLUSIVE MEMBER </p>
                    <p class="teal_banner_line2"> AT AN </p>
                    <p class="teal_banner_line3"> INTRODUCTORY PRICE </p> 
                </p>
            </div>
            <div class="addtocart_teal_card">
            <div class="addtocart_cardone">
                    <p>a</p>

                </div>
                <div class="addtocart_cardtwo">
                    <p>a</p>

                </div>
            </div>
            </div>



        </body>
    </div>


)

export default withAmp(exclusive , {hybrid:true})
